const Club = (props) => {
  const renderMembers = () => {
    return props.cardClub.members.map((member) => {
      return <li>{member}</li>;
    });
  };
  return (
    <li className="list__item">
      <i className={`icon ${props.cardClub.fa}`} />
      <div>
        <h2 className="item__title">{props.cardClub.name}</h2>
        <h3>Members:</h3>
        <ul className="item__members">{renderMembers()}</ul>
      </div>
    </li>
  );
};

export default Club;
